import React, { useEffect } from 'react';

const App = () => {
  useEffect(() => {}, []);
  const clickHandler = async () => {};
  return (
    <div>
      <header>
        <p>App</p>
        <button onClick={clickHandler}>Click</button>
      </header>
    </div>
  );
};

export default App;
